arr.forEach(function (filename){
	var element = filename.split('/')[0]
	if (new RegExp(element + '.html').test(filename) && filename.substr(0,4) == 'core' || filename.substr(0, 5) == 'paper'){
		//Template.__checkName(element);
		Template[element.replace(/\-/g, '_')] = new Template("Template." + element.replace(/\-/g, '_'), (elementFunction(element)));
		Template[element.replace(/\-/g, '_') + '_link'] = new Template("Template." + element.replace(/\-/g, '_') + '_link', (linkFunction(element)));
	}
})




function elementFunction(element){
	return function() {
		var view = this;
		return [ Spacebars.include(view.lookupTemplate(element.replace(/\-/g, '_') + '_link')), HTML.getTag(element)(HTML.Attrs(function() {
			return Spacebars.attrMustache(view.lookup("attrs"));
		}), Blaze._InOuterTemplateScope(view, function() {
			return Spacebars.include(function() {
				return Spacebars.call(view.templateContentBlock);
			});
		})) ];
	}
}

function linkFunction(element){
	return function() {
		var view = this;
		return [ HTML.Raw('<head>\n		<link rel="import" href="/bower_components/' + getFolder(element) + '/' + element + '.html">\n	</head>\n	')];
	}
}

function getFolder(element){
	return element == 'paper-tab' ? 'paper-tabs' : element;
}